import Header from './MyComponets/Header';
import Slider from './MyComponets/Slider';
import {Content} from './MyComponets/Content';
import {Footer} from './MyComponets/Footer';
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('main_cust')
);

function App() {
  return (
  <>
  <Header title="My React App"/>
  <Slider/>
  <Content/>
  <Footer/>
  </>
  );
}

export default App;
